import React, { useState, useEffect } from 'react';
import { quizAPI } from '../services/api';
import { Link } from 'react-router-dom';

const AvailableQuizzes = () => {
  const [quizzes, setQuizzes] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    fetchQuizzes();
  }, []);

  const fetchQuizzes = async () => {
    try {
      const response = await quizAPI.getAvailableQuizzes();
      setQuizzes(response.data);
    } catch (error) {
      setError('Error fetching quizzes');
      console.error('Error:', error);
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <div className="d-flex justify-content-center align-items-center" style={{ height: '80vh' }}>
        <div className="spinner-border text-primary" role="status">
          <span className="visually-hidden">Loading...</span>
        </div>
      </div>
    );
  }

  return (
    <div className="container mt-4">
      <div className="row mb-4">
        <div className="col-12">
          <h1 className="display-4">Available Quizzes</h1>
          <p className="lead">Choose a quiz to test your knowledge!</p>
        </div>
      </div>

      {error && (
        <div className="alert alert-danger" role="alert">
          <i className="fas fa-exclamation-triangle me-2"></i>
          {error}
        </div>
      )}

      {quizzes.length === 0 ? (
        <div className="text-center py-5">
          <i className="fas fa-inbox fa-5x text-muted mb-4"></i>
          <h3 className="text-muted">No Quizzes Available</h3>
          <p className="text-muted">Check back later for new quizzes!</p>
        </div>
      ) : (
        <div className="row">
          {quizzes.map((quiz) => (
            <div key={quiz.id} className="col-md-6 col-lg-4 mb-4">
              <div className="card h-100 shadow-sm hover-shadow">
                <div className="card-body d-flex flex-column">
                  <div className="d-flex justify-content-between align-items-start mb-3">
                    <h5 className="card-title">{quiz.title}</h5>
                    <span className="badge bg-primary">
                      <i className="fas fa-clock me-1"></i>
                      {quiz.durationMinutes}m
                    </span>
                  </div>
                  
                  <p className="card-text text-muted flex-grow-1">
                    {quiz.description || 'No description available'}
                  </p>
                  
                  <div className="mt-auto">
                    <div className="d-flex justify-content-between align-items-center mb-3">
                      <small className="text-muted">
                        <i className="fas fa-question-circle me-1"></i>
                        Questions: {quiz.questions?.length || 'N/A'}
                      </small>
                      <small className="text-muted">
                        <i className="fas fa-star me-1"></i>
                        Max Score: {quiz.totalMarks || 'N/A'}
                      </small>
                    </div>
                    
                    <Link
                      to={`/quiz/${quiz.id}`}
                      className="btn btn-primary w-100"
                    >
                      <i className="fas fa-play me-2"></i>
                      Start Quiz
                    </Link>
                  </div>
                </div>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default AvailableQuizzes;
